  function handleClick() {
    if (display == 'none') {
      setDisplay('block')
    } else {
      setDisplay('none')
    }
  }

  return (
    <div>
      <div>
        Graph Options
      </div>
      <div style={{display:display}}>
        { props.children }
      </div>

    </div>
  )
}

